import styled from 'styled-components/native';

export const PageBackground = styled.ImageBackground`
    padding: 0px 30px;
    justify-content: space-around;
    align-items: center;
    width: 100%;
    height: 100%;
    position: absolute;
    top: 0;
    right: 0; 
`;
